import React from "react";
import Input from "/Input";


function Form() {
    return (
        <div>
            <Input
                type="text"
                placeholder="enter your username"
            />
            <Input
                type="password"
                placeholder="enter your password"
            />
            <button>Register</button>
        </div>);

}

export default Form;
